function Navigator({guidList}: { guidList: Object[] }) {
  return (
    <div className={styles.nav}>
      <a href='https://github.com/'>Just SuperResolution!</a>
      <a href='https://github.com/'>Just SuperResolution!</a>
      <a href='https://github.com/'>Just SuperResolution!</a>
      <span></span>
    </div>
  )
}

export default Navigator
